CREATE TABLE usuarios (
  id INTEGER PRIMARY KEY,
  nome VARCHAR(100) UNIQUE NOT NULL,
  email VARCHAR(100) UNIQUE NOT NULL,
  senha VARCHAR(250) NOT NULL
);


CREATE TABLE papeis (
  id INTEGER PRIMARY KEY,
  nome VARCHAR(100) UNIQUE NOT NULL,
  descricao VARCHAR(100) UNIQUE NOT NULL
);


CREATE TABLE usuario_papel (
    id_usuario INT NOT NULL,
    id_papel INT NOT NULL,
    PRIMARY KEY(id_usuario, id_papel)
);

ALTER TABLE usuario_papel ADD CONSTRAINT fk_usuario_papel_usuario FOREIGN KEY (id_usuario) REFERENCES usuarios (id);
ALTER TABLE usuario_papel ADD CONSTRAINT fk_usuario_papel_papel FOREIGN KEY (id_papel) REFERENCES papeis (id);


CREATE TABLE cidade (
	id SERIAL PRIMARY KEY,
	nome VARCHAR(40) NOT NULL,
	uf CHAR(2) NOT NULL
);

CREATE TABLE bairro (
	id SERIAL PRIMARY KEY,
	nome VARCHAR(60) NOT NULL,
	idcidade INT NOT NULL,
	FOREIGN KEY(idcidade) REFERENCES cidade(id)
);

CREATE TABLE pessoa (
	id SERIAL PRIMARY KEY,
	nome VARCHAR(50) NOT NULL,
	nomemae VARCHAR(50) NOT NULL,
	datanasc DATE NOT NULL,
	telefones VARCHAR(100) NOT NULL,
	email VARCHAR(30) NOT NULL,
	cpf CHAR(14) NOT NULL,
	idbairro INT,
	rua VARCHAR(60) NOT NULL,
	numero VARCHAR(15) NOT NULL,
	complemento VARCHAR(40) NOT NULL,
	cep CHAR(9) NOT NULL,
	FOREIGN KEY(idbairro) REFERENCES bairro(id)
);

CREATE TABLE batalhao (
	id SERIAL PRIMARY KEY,
	sigla VARCHAR(15),
	descricao VARCHAR(50) NOT NULL
);

CREATE TABLE policial (
	id SERIAL PRIMARY KEY,
	idpessoa INT,
	matricula VARCHAR(20),
	nome VARCHAR(50) NOT NULL,
	nomemae VARCHAR(50) NOT NULL,
	datanasc DATE NOT NULL,
	telefones VARCHAR(30) NOT NULL,
	email VARCHAR(30) NOT NULL,
	cpf CHAR(14) NOT NULL,
	idbatalhao INT,
	idbairro INT,
	rua VARCHAR(60) NOT NULL,
	numero VARCHAR(15) NOT NULL,
	complemento VARCHAR(40) NOT NULL,
	cep CHAR(9) NOT NULL,
	FOREIGN KEY (idbatalhao) REFERENCES batalhao (id),
	FOREIGN KEY (idbairro) REFERENCES bairro (id)
);

CREATE TABLE orgao (
	id SERIAL PRIMARY KEY,
	sigla VARCHAR(15),
	descricao VARCHAR(50) NOT NULL
);

CREATE TABLE setor (
	id SERIAL PRIMARY KEY,
	sigla VARCHAR(15),
	descricao VARCHAR(50) NOT NULL,
	idorgao INT NOT NULL,
	FOREIGN KEY (idorgao) REFERENCES orgao (id)
);

CREATE TABLE administrativo (
	id SERIAL PRIMARY KEY,
	idpessoa INT,
	matricula VARCHAR(20),
	nome VARCHAR(50) NOT NULL,
	nomemae VARCHAR(50) NOT NULL,
	datanasc DATE NOT NULL,
	telefones VARCHAR(30) NOT NULL,
	email VARCHAR(30) NOT NULL,
	cpf CHAR(14) NOT NULL,
	idsetor INT,
	idbairro INT,
	rua VARCHAR(60) NOT NULL,
	numero VARCHAR(15) NOT NULL,
	complemento VARCHAR(40) NOT NULL,
	cep CHAR(9) NOT NULL,
	FOREIGN KEY (idsetor) REFERENCES setor (id),
	FOREIGN KEY (idbairro) REFERENCES bairro (id)
);

CREATE TABLE patrulha (
	id SERIAL PRIMARY KEY,
	viatura VARCHAR(10) NOT NULL
);

CREATE TABLE patrulha_policial (
	id SERIAL PRIMARY KEY,
	idpatrulha INT NOT NULL,
	idpolicial INT NOT NULL,
	FOREIGN KEY (idpatrulha) REFERENCES patrulha (id),
	FOREIGN KEY (idpolicial) REFERENCES policial (id),
	UNIQUE (idpatrulha,idpolicial)
);

CREATE TABLE bairro_patrulha (
	id SERIAL PRIMARY KEY,
	idbairro INT NOT NULL,
	idpatrulha INT NOT NULL,
	FOREIGN KEY (idbairro) REFERENCES bairro (id),
	FOREIGN KEY (idpatrulha) REFERENCES patrulha (id),
	UNIQUE (idbairro,idpatrulha)
);

CREATE TABLE boletim_ocorrencia (
	id SERIAL PRIMARY KEY,
	numero VARCHAR(20) NOT NULL,
	datahora TIMESTAMP NOT NULL,
	idbairro INT,
	rua VARCHAR(60) NOT NULL,
	complemento VARCHAR(40) NOT NULL,
	cep CHAR(9) NOT NULL,
	descricao VARCHAR(400) NOT NULL,
	situacao VARCHAR(30) NOT NULL,
	idadministrativo INT NOT NULL,
	evidencia VARCHAR(100),
	FOREIGN KEY (idbairro) REFERENCES bairro (id),
	FOREIGN KEY (idadministrativo) REFERENCES administrativo (id)
);

CREATE TABLE vitima (
	id SERIAL PRIMARY KEY,
	caracteristicas VARCHAR(100),
	idpessoa INT,
	idboletimocorrencia INT NOT NULL,
	FOREIGN KEY (idpessoa) REFERENCES pessoa (id),
	FOREIGN KEY (idboletimocorrencia) REFERENCES boletim_ocorrencia (id)
);

CREATE TABLE suspeito (
	id SERIAL PRIMARY KEY,
	caracteristicas VARCHAR(100),
	idpessoa INT,
	idboletimocorrencia INT NOT NULL,
	FOREIGN KEY (idpessoa) REFERENCES pessoa (id),
	FOREIGN KEY (idboletimocorrencia) REFERENCES boletim_ocorrencia (id)
);

CREATE TABLE procurado (
	id SERIAL PRIMARY KEY,
	caracteristicas VARCHAR(100),
	idpessoa INT,
	idboletimocorrencia INT NOT NULL,
	FOREIGN KEY (idpessoa) REFERENCES pessoa (id),
	FOREIGN KEY (idboletimocorrencia) REFERENCES boletim_ocorrencia (id)
);

